const Footer = () => {
    let links = [
        {text: "Google", url: "https://www.google.com/"},
        {text: "Github", url: "https://www.github.com/"}
    ]

    let items = []

    let i = 0;
    links.forEach( ref => {
        items.push(<a key={i++} href={ref.url}> {ref.text} </a>)
    })

  return (
    <footer>
        <a href="" class="fa fa-facebook"></a>
        <a href="" class="fa fa-twitter"></a>
        <nav>
            {items}
        </nav>

